              DAILY
            </Link>
            <Link className='top' to='/analytics'>
              WEEKLY
            </Link>
            <Link className='top' to='/analytics'>
              MONTHLY
            </Link>
          </div>
          <Table responsive>
            <thead>
              <tr className = 'font'>
                <th>Number of orders</th>
                <th>Most ordered item</th>
                <th>Revenue</th>
              </tr>
            </thead>
            <tbody>
              {/* <th>{this.state.sections.length}</th> */}
              {/* <td className = 'font'>{this.state.sections.length}</td> */}
              {/* {this.state.sections.map(({...otherSectionProps }) => (
